Here's your contract code written in Solidity:

```solidity
pragma solidity ^0.5.16;

contract YourContract {
    string public name;
    string public symbol;
    uint256 public decimals;
    uint256 public _totalsupply;
    uint256 public tokens;
    uint256 public oneeth;
    uint256 public icoenddate;
    bool public stopped;
    address payable public owner;
    address payable public ethfundmain;
    mapping(address => uint256) public balanceof;
    mapping(address => mapping(address => uint256)) public allowance;

    constructor() public payable {
        owner = msg.sender;
        ethfundmain = 0x1e6d1Fc2d934D2E4e2aE5e4882409C3fECD769dF;
        decimals = 9;
        _totalsupply = 0x2faf080 * 10 ** decimals;
        oneeth = 10000;
        icoenddate = 0x5b888500;
        stopped = false;
        if (msg.value == 0) {
            balanceof[owner] = _totalsupply;
        }
    }

    function approve(address _spender, uint256 _value) public {
        tokens = _value * 10 ** decimals;
        allowance[msg.sender][_spender] = tokens;
    }

    function() external payable {
        require(!stopped && msg.sender != owner && 10 ** decimals != 0 && now < icoenddate && msg.value >= 0x470de4df820000);
        tokens = (msg.value / 10 ** decimals) * oneeth;
        balanceof[msg.sender] += tokens;
        balanceof[owner] -= tokens;
    }

    function transferFrom(address _from, address _to, uint256 _value) public {
        tokens = _value * 10 ** decimals;
        require(balanceof[_from] >= tokens && allowance[_from][msg.sender] >= tokens && tokens >= 0);
        balanceof[_from] -= tokens;
        allowance[_from][msg.sender] -= tokens;
        balanceof[_to] += tokens;
    }

    function drain() public {
        require(msg.sender == owner);
        ethfundmain.transfer(address(this).balance);
    }

    function transfer(address _to, uint256 _value) public {
        require(_to != owner);
        tokens = _value * 10 ** decimals;
        balanceof[_to] += tokens;
        balanceof[owner] -= tokens;
    }

    function ResumeICO() public {
        require(msg.sender == owner);
        stopped = false;
    }

    function PauseICO() public {
        require(msg.sender == owner);
        stopped = true;
    }
}
```
